class xInfbr:
	def __init__(self, session):
		self.session = session
		self.onClose = []
		self.infinstance = None
		self.xip = None
		self.xip2 = None
		self.__event_tracker = ServiceEventTracker(screen=self, eventmap={iPlayableService.evStart: self.__evStart})
		self.xTimer = eTimer()
		self.xTimer.callback.append(self.onInf)
		self.xTimer.start(200, True)

	def onInf(self):
		try:
			self.infinstance = InfoBar.instance
			if self.infinstance:
				self.xip = self.session.instantiateDialog(xtraInfobarPoster.xtraInfobarPoster)
				self.xip2 = self.session.instantiateDialog(xtraInfobarPoster.xtraInfobarPoster2)
				self.infinstance.onShowHideNotifiers.append(self.showHide)
		except Exception as err:
			from Tools.xtraTool import errorlog
			errorlog(err, __file__)

	def showHide(self, ansver):
		try:
			if ansver:
				if self.xip.shown:
					self.xip.show()
					self.xip2.show()
			else:
				if self.xip.shown:
					self.xip.hide()
					self.xip2.hide()
		except Exception as err:
			from Tools.xtraTool import errorlog
			errorlog(err, __file__)

	def __evStart(self):
		if self.xip:
			self.xip.getmc()
			self.xip2.getmc()
			self.xip.show()
			self.xip2.show()

